import React from 'react'
import styled from "@emotion/styled";

const Row = styled.div`
    display: flex;
    border: 1px solid;
    width: 100%;
    justify-content: space-between;
`

const CountryCase = ({ name, cases }) => {
    return (
        <Row>{cases} {name}</Row>
    );
}

export default CountryCase
